module.exports = async d => {
    const code = d.command.code

    const r =code.split("$round[").length - 1

    const inside = code.split("$round[")[r].split("]")[0]

    const n = Number(inside)

    if (!n) return d.error(`:x: Invalid number in \`$round[${inside}]\``)

    return {
        code: code.replaceLast(`$round[${inside}]`, Math.round(n))
    }
}